      if (idx == 0) return u_colors[0];
      if (idx == 1) return u_colors[1];
      if (idx == 2) return u_colors[2];
      if (idx == 3) return u_colors[3];
      if (idx == 4) return u_colors[4];
      if (idx == 5) return u_colors[5];
      if (idx == 6) return u_colors[6];
